INSERT INTO `cn_chat_rooms` VALUES (2,'电影聊天室','记住全世界你都是观众,你喜欢那些电影， 非常精彩观后感或者有推荐给大家分享的来这里说出你的经典影评吧!','601e06fbbc88e3.27082560_qlmfoehpgnjki.jpeg',0,'',1,NULL,'movies','[\"1\",\"2\",\"4\",\"3\"]',1,1),(3,'青春聊天室','青春是杯浓啡咖,虽可以使人精神为之振奋,但仍不免有丝丝的苦涩。青春是一株无名的草。它虽不怎麼起眼,却经得起风吹雨打','601e076fe0b4e8.94184902_emqhfkgjniolp.png',0,'',1,NULL,'youths','[\"1\",\"2\",\"4\",\"3\"]',1,1),(4,'迪迦奥特曼','约在三千万年前，人类处于超古代文明时期，守护人类的巨人们发生内战，原是地球最强的黑暗战士迪迦在受幽怜的感动后选择成为光之战士','601e0f97bbffb2.28551344_ojhmlknfqepgi.jpeg',0,'',1,NULL,'Tigaultraman','[\"1\",\"2\",\"4\",\"3\"]',1,1),(5,'雷欧奥特曼','雷欧奥特曼是来自狮子座L77行星的战士,由于原来所居住的母星遭到玛格玛星人的侵略毁灭而到了地球.他受诸星团赛文奥特曼之托加入宇宙巡逻队MAC与无数觊觎地球的怪兽及宇宙人战斗！','601e0fbb7f7e17.48483919_mkiqhnfopjgle.jpeg',0,'',1,NULL,'Lenoultraman','[\"1\",\"2\",\"4\",\"3\"]',1,1),(6,'爱因斯坦','阿尔伯特·爱因斯坦（德语/英语：Albert Einstein）（1879年3月14日—1955年4月18日），出生于德国巴登－符腾堡州乌尔姆市，毕业于苏黎世联邦理工学院，现代物理学家。','601e0fd76cf511.50490291_fgjqomliekhnp.jpeg',0,'',1,NULL,'Einstein','[\"1\",\"2\",\"4\",\"3\"]',1,1),(7,'新冠聊天室','倡导交流预防新型冠状病毒感染的正确认识和防范意识，以及如何看待本次疫情的状况，谈谈给你的感受，诉说你在疫情的故事，隔离疫情,不隔离爱!','601e10289a4252.68801647_jnopflqmihkeg.png',0,'',1,NULL,'covid','[\"1\",\"4\",\"2\",\"3\"]',1,1),(8,'旅游聊天室','“旅”是旅行，外出，即为了实现某一目的而在空间上从甲地到乙地的行进过程；“游”是外出游览、观光、娱乐，即为达到这些目的所作的旅行','601e104154fbd7.33636335_ikflnpgeojqmh.jpeg',0,'',1,NULL,'tourism','[\"1\",\"2\",\"4\",\"3\"]',1,1),(9,'创业点子','你家里人',NULL,0,'',1,NULL,'Jimmy','[\"1\"]',1,1),(10,'123','',NULL,0,'',1,NULL,'123','[\"1\",\"4\",\"2\"]',1,67);
